import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the first product card to open the modal
    const productCardLocator = page.locator('.product-card').first();
    await productCardLocator.waitFor({ state: 'visible', timeout: 5000 });
    await productCardLocator.click();

    // Wait for the modal to be visible
    const modalLocator = page.locator('#productModal');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract the title from the modal to verify it opened correctly
    const modalTitle = await page.locator('.product-detail-title').textContent();

    return {
      success: true,
      action: "Opened the product detail modal by clicking on a product card.",
      extractedData: {
        modalTitle: modalTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open the product detail modal.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
